import React, { Fragment } from 'react';
import 'react-slideshow-image/dist/styles.css';
import Billeterie from './Billeterie';
import Msg_important from './Msg_important'
import Reseau_sociaux from './Reseau_sociaux'

const Accueil = () => {

  return (
    <Fragment> 
      <Msg_important />
      <Billeterie />
      
      <Reseau_sociaux />
    </Fragment> 
  ) 
}

export default Accueil;
